import React from "react"


class guesse extends React.Component
{   
    formateString(string){
        let words = this.props.word;
        let cachedword = [];
        for(word in words)
        {
            cachedword.push(word === " " ? "_ " : word)
        }
        return (cachedword);
    }
    render(){
        return (
        <div>
            {this.props.word.split("").map((elem) => "_ ")}
        </div>
        )
    }

}

export default guesse
